import clsx from 'clsx';
import React from 'react';
import servingsParameter from '../../../styles/styles';

const Servings: React.FC<{
	servings;
}> = ({ servings }) => {
	return (
		<div
			className={clsx(servingsParameter, 'border-[#D20C0C]', 'bg-[#d20c0c1b]')}
		>
			<h5 className={clsx('nunito-sans-normal', 'text-xl', 'text-[#D20C0C]')}>
				Hard
			</h5>
		</div>
	);
};

export default Servings;
